(9, 0, 'PirvacyPolicy', 'Privacy Policy', '<li class="faqs-list"><!-- main -->\n                        <h4>Information collection</h4>\n                        <ul class="faqs-list-group">\n                            <li>In order to provide a better service to you, we may collect and process the following data about you:</li>\n                            <ul class="faqs-list-group">\n                                <li> information that you provide by filling in forms on our site www.getkobe.com (&quot;our site&quot;). This includes information provided at the time of registering to use our site, subscribing to our service, posting material or requesting further services. We may also ask you for information at other times, for example in connection with a promotion or when you report a problem with oursite;</li>\n                                <li> if you contact us, we may keep a record of that correspondence;</li>\n                                <li> we may also ask you to complete surveys that we use for research purposes, although you do not have to respond to them;</li>\n                                <li> details of your visits to our site and the resources that you access.</li>\n                            </ul>\n                            <li>We only retain personal data for so long as it is necessary. Data may be archived as long as the purpose for which the data was used still exists.</li>\n                        </ul>\n                    </li><!-- main -->\n\n                    <li class="faqs-list"><!-- main -->\n                      <h4>Uses made of the information</h4>\n                        <ul class="faqs-list-group">\n                            <li>The purposes for which information may be used by us in and outside Singapore include:\n                                <ul class="faqs-list-group">\n                                    <li> ensuring that content from our site is presented in the most effective manner for you and for your computer;</li>\n                                    <li>providing you with alerts, newsletter, education materials or information that you requested or signed up to;</li>\n                                    <li> carrying out our obligations arising from any contracts entered into between you and us;</li>\n                                    <li> allowing you to participate in interactive features of our service, when you choose to do so;</li>\n                                    <li>designing and conducting surveys/questionnaires for client profiling/segmentation, statistical analysis, improving and furthering the provision our products and services;</li>\n                                    <li>complying with laws and regulations applicable to us or any of our affiliates in or outside Singapore;</li>\n                                    <li>legal proceedings, including collecting overdue amounts and seeking professional advices;</li>\n                                    <li>researching, designing and launching services or products including seminars/events/forums;</li>\n                                    <li>promoting and marketing services and products subject to your exercise of the opt-out right (please see further details in Clause 2.2 below); or</li>\n                                    <li>purposes directly related or incidental to the above.</li>\n                                </ul>\n                            </li>\n                            <li>We intend to use your data in direct marketing and we require your consent (which \n                               includes an indication of no objection) for that purpose. In this connection, please note that:\n                               <ul class="faqs-list-group">\n                                    <li> your name, contact details (including address, contact number, email address), products and services information, transaction pattern and behaviour, background and demographic data held by us from time to time may be used by us in direct marketing;</li>\n                                    <li> the following classes of services, products and subjects may be marketed in direct marketing:\n                                        <ul class="faqs-list-group">\n                                            <li>(i) services and products related to our site and/or our affiliates (including marketing affiliates programs we are a part of);</li>\n                                            <li>(ii) reward, loyalty or privileges programmes, promotional offers and related services; and</li>\n                                            <li>(iii) invitations to events such as seminars/webinars/tele-seminars, conferences, live programs or events.</li>\n                                        </ul>\n                                    </li>\n                                    <li> We may conduct direct marketing via fax, email, direct mail, telephone and other means of communication or send e-newsletters to you. You may choose not to receive promotional materials, by simply telling us (see below for contact details), and we will cease to do so, without charge.</li>\n                               </ul>\n                            </li>\n                        </ul>\n                    </li><!-- main -->\n\n                    <li><!-- main -->\n                        <h4>Disclosure of your information</h4>\n                        <ul class="faqs-list-group">\n                            <li>We will keep the personal data we hold confidential but may provide information to:\n                                <ul class="faqs-list-group">\n                                    <li> personnel, agents, advisers, auditors, contractors, financial institutions, and service providers in connection with our operations or services;</li>\n                                    <li> our overseas offices, affiliates, business partners and counterparts (if any);</li>\n                                    <li> persons under a duty of confidentiality to us;</li>\n                                    <li>persons to whom we are required to make disclosure under applicable laws and regulations in or outside Singapore; or</li>\n                                    <li> actual or proposed transferees or participants of our services in or outside Singapore.</li>\n                                </ul>\n                            </li>\n                        </ul>\n                    </li><!-- main -->\n\n                    <li><!-- main -->\n                        <h4>Cookies</h4>\n                        <ul class="faqs-list-group">\n                            <li>Our website uses cookies to distinguish you from other users of our website. This helps us to provide you with a good experience when you browse our website and also allows us to improve our site. By continuing to browse the site, you are agreeing to our use of cookies.</li>\n                            <li>A cookie is a small file of letters and numbers that we store on your browser or the hard drive of your computer if you agree. Cookies contain information that is transferred to your computer''s hard drive.</li>\n                            <li>We use the following cookies:\n                                <ul class="faqs-list-group">\n                                    <li><b>Analytical/performance cookies.</b>They allow us to recognise and count the number of visitors and to see how visitors move around our website when they are using it. This helps us to improve the way our website works, for example, by ensuring that users are finding what they are looking for easily. </li>\n                                </ul>\n\n                            </li>\n                            <li>Please note that third parties (including, for example, advertising networks and providers of external services like web traffic analysis services) may also use cookies, over which we have no control. These cookies are likely to be analytical/performance cookies or targeting cookies.</li>\n                            <li>Our website uses Google Analytics, a web traffic analysis service provided by Google Inc. ("Google"). Please refer to <a href="http://www.google.com/policies/privacy/partners" target="_blank">http://www.google.com/policies/privacy/partners</a> find out more about how Google uses data when you use our website and how to control the information sent to Google.</li>\n                            <li>You block cookies by activating the setting on your browser that allows you to refuse the setting of all or some cookies. However, if you use your browser settings to block all cookies (including essential cookies) you may not be able to access all or parts of our site.</li>\n                            <li>Furthermore, you can prevent Google''s collection and processing of data by using the Google Ads Settings page or downloading and installing their browser plug-in (<a href="https://tools.google.com/dlpage/gaoptout" target="_blank">https://tools.google.com/dlpage/gaoptout</a>).</li>\n                        </ul>            \n                    </li><!-- main -->\n\n                    <li><!-- main -->\n                        <h4>Security</h4>\n                        <ul class="faqs-list-group">\n                            <li>All information you provide to us is stored on our secure servers. Where we have given you (or where you have chosen) a password which enables you to access certain parts of our site, you are responsible for keeping this password confidential. We ask you not to share a password with anyone.</li>\n                            <li>Unfortunately, the transmission of information via the internet is not completely secure. Although we will do our best to protect your personal data, we cannot guarantee the security of your data transmitted to our site; any transmission is at your own risk and you agree not to hold us responsible for any breach of security while accessing the internet that is out of our control. Once we have received your information, we will use strict procedures and security features to try to prevent unauthorised access.</li>\n                        </ul>\n                    </li><!-- main -->\n\n                    <li><!-- main -->\n                        <h4>Third party websites</h4>\n                        <p>Our website may contain links to other sites (the <b>"Linked Sites"</b>). We are not responsible for the privacy policies or practices of such other Linked Sites. We encourage our users to be aware when leaving our website to read the privacy policies or statements of each Linked Site that collects your personal data. You agree to waive any claim against us with respect to the Linked Sites.</p>\n                    </li><!-- main -->\n\n                    <li><!-- main -->\n                        <h4>Changes to our privacy policy</h4>\n                        <p>Any changes we may make to our Privacy Policy in the future will be posted on this page. Your continued use of our services constitutes your agreement to this Privacy Policy and any updates.</p>                    \n                    </li><!-- main -->\n\n                    <li><!-- main -->\n                        <h4>Data transfers</h4>\n                        <p>We may hold your data on servers in Singapore  and any other territories as we see fit from time to time. We may also transfer your data to our overseas offices or to any people listed at Clause 3.1 above, who may be located in or outside of Singapore.</p>\n                    </li><!-- main -->\n\n                    <li><!-- main -->\n                        <h4>Your consent and rights</h4>\n                        <ul class="faqs-list-group">\n                            <li>By using our service, making an application or visiting our website, you consent to the collection and use of your information and other activities as outlined in this policy.</li>\n                            <li>Under the Personal Data Protection Act (the "PDPA"), individuals have the right:\n                                <ul class="faqs-list-group">\n                                    <li> to check whether we hold personal data about you and to access such data;</li>\n                                    <li> to require us to correct as soon as reasonably practicable any data relating to you that is inaccurate;</li>\n                                    <li> to ascertain our policies and practices in relation to personal data and the kind of personal data held by us; and</li>\n                                    <li> to object to the use of your personal data for marketing purposes and we shall not use your personal data for marketing purposes after you communicate your objection to us.</li>\n                                </ul>\n                            </li>\n                            <li>You may exercise your opt-out right by notifying us if you wish to object to the use of your personal data for direct marketing purposes. Please send requests for such objections, access to data, correction of data, information regarding policies and practices and kinds of data held, questions or complaints to:\n                            <br/>\n                            <i>\n                            Name: Evangeline<br/>\n                            Address: 190 Clemenceau Avenue #06-05 Singapore 239924<br/>\n                            Tel: <a href="">+65 6708 8287</a><br/>\n                            Email: <a href="">hello@getkobe.com</a><br/>\n                            </i>\n                            </li>\n                            <li>In accordance with the terms of the PDPA, we have the right to and may charge a minimum fee for processing any data access request.</li>\n                        </ul>\n\n                    </li><!-- main -->\n\n                    <li><!-- main -->\n                        <h4>Governing law and jurisdiction</h4>\n                        <p>Nothing in this Privacy Policy shall limit the rights of the data subject under the PDPA. This Privacy Policy shall be governed by the laws of Singapore. You agree to submit to the exclusive jurisdiction of the Singapore courts.</p>\n                    </li><!-- main -->', '2017-03-31 18:30:00', '2017-08-21 09:52:11'),
