(11, 0, 'Header_Heading', 'header heading', '<p>Where great brands get great social media influence</p>', '2017-03-31 18:30:00', '2017-08-18 06:01:49'),
(12, 0, 'Header_Description', 'header description', 'Kobe is a self serve word-of-mouth marketplace pairing social media users to businesses  giving them access to scalable word-of-mouth marketing while rewarding social media users.', '2017-03-31 18:30:00', '2017-08-17 05:05:47'),
(13, 0, 'Why_Kobe', 'Why Kobe', '<p>Kobe is a self-serve word-of-mouth marketplace which pairs social-media influencers to businesses - Giving businesses access to scalable WOM monthly, while rewarding SM influencers</p>', '2017-03-31 18:30:00', '2017-08-18 06:02:04'),
(15, 0, 'Satisfaction_Guaranteed', 'Satisfaction Guaranteed', '<p>Business designs the result they want, influencers enjoys freedom on their content.</p>', '2017-03-31 18:30:00', '2017-08-18 06:02:17'),
(16, 0, 'Do_It_Yourself', 'Do It Yourself (DIY)', '<p>100% end to end self serve platform, safe, quick and easy to use.</p>', '2017-03-31 18:30:00', '2017-08-18 06:02:31'),
(17, 0, 'Matching', 'Matching', '<p>Business paired with influencers with data and technologies.</p>', '2017-03-31 18:30:00', '2017-08-18 06:02:40'),
(18, 0, 'Power_of_Everyone', 'Power of Everyone', '<p>Harness the influence of masses; a bunch of chopsticks is stronger than a pair</p>', '2017-03-31 18:30:00', '2017-08-18 06:02:50'),
(19, 0, 'How_Kobe_Works', 'How Kobe Works11', '<p>This is a heading.</p>', '2017-03-31 18:30:00', '2017-08-17 06:00:17'),
(20, 0, 'For_Businesses', 'For Businesses', '<p>Businesses have always relied on Word-of-Mouth () to spread their word passively as a means of survival. However, they lack the marketing know-how, neither do they have the time or resources to invest in marketing to get more Word-of-Mouth ().</p>', '2017-03-31 18:30:00', '2017-08-18 06:03:12'),
(21, 0, 'For_Influencers', 'For Influencers', '<p>There is a lack of marketplace for social media users to generate more traction out of their social media content. We don&#39;t need you to have huge-ass follower count, but we believe in fiercely protecting individual&#39;s freedom and originality</p>', '2017-03-31 18:30:00', '2017-08-18 06:03:23'),
(22, 0, '3_Easy_Steps', '3 Easy Steps', '<p>This is a heading.</p>', '2017-03-31 18:30:00', '2017-08-18 06:03:31'),
(23, 0, 'Advertiser_Create_a_Campaign', 'Create a Campaign', '<p>Create a campaign and design the results you want from social media users; we&rsquo;ll do the rest!</p>', '2017-03-31 18:30:00', '2017-08-18 06:03:42'),
(24, 0, 'Advertiser_Match', 'Match', '<p>Algorithmic matching backed with data to find the perfect partnerships</p>', '2017-03-31 18:30:00', '2017-08-18 06:03:53'),
(25, 0, 'Advertiser_Get_Results', 'Get Results', '<p>Social media posts go live, word-of-mouth delivered! </p>', '2017-03-31 18:30:00', '2017-08-18 06:04:03'),
(26, 0, 'Advertiser_Mid_Section', 'A scalable and accessible solution to connect with your target audience.11', '<p>Get Kobe has proven to be one of the best solutions currently in the market for connecting with social media influencers around the world.11</p>', '2017-03-31 18:30:00', '2017-08-17 06:40:57'),
(27, 0, 'Influencer_Create_a_Profile', 'Create your Profile12', '<p>Sign up for an account and get your account activated, our technology will analyse your profile to determine your area of expertise and your estimated payout12</p>', '2017-03-31 18:30:00', '2017-08-17 06:45:54'),
(29, 0, 'Influencer_Match', 'Match 12', '<p>Receive invites, accept and work with brands you love. 12</p>', '2017-03-31 18:30:00', '2017-08-17 06:45:38'),
(30, 0, 'Influencer_Get_Paid', 'Get Paid12', '<p>Automatically receive payment once your post goes live!12</p>', '2017-03-31 18:30:00', '2017-08-17 06:46:16'),
(31, 0, 'Influencer_Mid_Section', 'The power to influence belongs to the masses.12', '<p>Get Kobe has proven to be one of the best solutions currently in the market for connecting with social media influencers around the world.12</p>', '2017-03-31 18:30:00', '2017-08-17 06:50:12'),
