(33, 0, 'Coverage_1', 'Coverage 1', '<p>Thank you to the Get Kobe team! The team has ben suportive throughout the whole process of spreading our business&rsquo;s word of mouth. Get Kobe works and its hassle free!11</p>', '2017-03-31 18:30:00', '2017-08-17 07:07:20'),
